myApp.controller("homeController",["$scope","$http","ApiFactory","newsFactory",function(e,t,o,n){e.searchbarClicked=!1,e.buttonSearchClicked=!1,e.suggestions=[],e.userEntry="",e.toggleNews=function(){n.newsClicked=!n.newsClicked,console.log("yes")},e.typeahead=function(){t.get(o.api+"search/complete?q="+e.userEntry+"&limit=5").then(function(t){e.suggestions=t.data.result},function(e){console.log("Unable to retrieve data from the API :/")})}}]);